import React from "react";





const Red = (props) => {

    const Red_marker = {
        margin:'35% 10% 15% 40%',
        /* margin: 25% 10% 15% 30%; */
        /* position: absolute; */
        backgroundColor: 'rgb(241, 34, 34)',
        borderRadius: '50%',
        border: '1px solid rgb(0, 0, 0)',
        gridRowStart: props.position.x,
        gridColumnStart: props.position.y,
    };
    if(!props.turn && props.enter_enabled){
        console.log("Red done");
    }
    return(
        <div 
            style={Red_marker}
            className={props.turn && props.enter_enabled ?"blinker1":""}
            />
    );
}
export default Red
